import React from "react";

function Hero() {
  return (
    <div className="flex flex-col w-full bg-yellow-400 items-center justify-items-center">
      <div className="flex flex-row w-10/12 items-center justify-items-center">
        <div className="flex w-full">
          <img src="/images/tajmahal.jpeg" alt="Tajmahal"></img>
        </div>
      </div>
    </div>
  );
}

export default Hero;
